// File: src/routes/message.js
// Handles `/messages` resource

import { Router } from "express";
import { v4 as uuidv4 } from "uuid";
const router = Router();

// GET /messages
router.get("/", (req, res) => {
  res.send(Object.values(req.context.models.messages));
});

// GET /messages/:messageId
router.get("/:messageId", (req, res) => {
  res.send(req.context.models.messages[req.params.messageId]);
});

// POST /messages
router.post("/", (req, res) => {
  const id = uuidv4();
  const message = {
    id,
    text: req.body.text,
    userId: req.context.me.id,
  };
  req.context.models.messages[id] = message;
  res.send(message);
});

// DELETE /messages/:messageId
router.delete("/:messageId", (req, res) => {
  const { [req.params.messageId]: message, ...others } =
    req.context.models.messages;
  req.context.models.messages = others;
  res.send(message);
});

export default router;

